import './App.css';
import SignUpForm from './components/SignUpForm';
import LoginForm from './components/LoginForm';
import {BrowserRouter, Route, Routes} from 'react-router-dom';
import Nav from './components/Nav';
import PersonalInfo from './components/PersonalInfo';
import { APIContext } from './contexts/APIContext';
import { useAPIContext } from './contexts/APIContext';
import {PersonalUpdateForm} from './components/PersonalInfo';
import SearchForm from './components/SearchForm';
import CreatePropertyForm from './components/CreatePropertyForm';
import Logout from './components/Logout';


function App() {
  // change the background color
  document.body.style.backgroundColor = "#fffeee";

  return (

      <BrowserRouter>

        <Routes>

          <Route path="/" element={
            <>
              <Nav/>
            </>
          }>
          
            <Route path='/signup' element={
            
            <APIContext.Provider value={useAPIContext()}>

              <SignUpForm/>

            </APIContext.Provider>

            
            }/>

            <Route path="/login" element={

              <APIContext.Provider value={useAPIContext()}>
              
                <LoginForm/>

              </APIContext.Provider>
              
            
            }/>
            
            <Route path="/logout" element={
              <APIContext.Provider value={useAPIContext()}>
                <Logout/>
              </APIContext.Provider>
              }
            />

            <Route path="/user_info" element={
              <APIContext.Provider value={useAPIContext()}>
                <PersonalInfo/>
              </APIContext.Provider>
              }
            />

            <Route path="/update_info" element={
              <APIContext.Provider value={useAPIContext()}>
                <PersonalUpdateForm/>
              </APIContext.Provider>
              }
            />

            <Route  path="/property/list" element={
              < SearchForm />
            } />

            <Route path="/property/create" element={
              < CreatePropertyForm />
            } />

          </Route>

        </Routes>
  
      </BrowserRouter>

  );
}

export default App;
